import { Link } from "react-router-dom";
import { useCart } from "./context/CartContext";
import { useWishlist } from "./context/WishlistContext";
import logo from "./assets/floris-logo.png";
import { Menu, Search, ShoppingBag, User, Heart } from "lucide-react";
import { MENU_ITEMS } from "./data";
import { useState } from "react";

export default function Navbar({ onOpenMenu, onOpenCart, onOpenSearch }) {
  const { cart } = useCart();
  const { wishlist } = useWishlist();
  const [isAccountOpen, setIsAccountOpen] = useState(false);

  return (
    <>
      <div style={styles.topBar}>
        <span>Complimentary Gift on Orders Above â‚¹2500 | Free Shipping</span>
      </div>

      <header style={styles.header}>
        {/* LEFT: HAMBURGER & SEARCH */}
        <div style={styles.left}>
          <button onClick={onOpenMenu} style={styles.iconBtn}>
            <Menu size={24} strokeWidth={1.5} />
          </button>
          <button onClick={onOpenSearch} style={styles.iconBtn}>
            <Search size={22} strokeWidth={1.5} />
          </button>
        </div>

        {/* CENTER: LOGO */}
        <div style={styles.center}>
          <Link to="/">
            <img src={logo} alt="Floris" style={styles.logo} />
          </Link>
        </div>

        {/* RIGHT: ACCOUNT, WISHLIST, CART */}
        <div style={styles.right}>

          {/* ACCOUNT DROPDOWN */}
          <div
            style={styles.accountWrap}
            onMouseEnter={() => setIsAccountOpen(true)}
            onMouseLeave={() => setIsAccountOpen(false)}
          >
            <button style={styles.iconBtn}>
              <User size={22} strokeWidth={1.5} />
            </button>

            {/* HOVER MENU */}
            {isAccountOpen && (
              <div style={styles.dropdown}>
                <Link to="/account" style={styles.dropLink}>My Account</Link>
                <Link to="/login" style={styles.dropLink}>Sign In</Link>
                <Link to="/register" style={styles.dropLink}>Register</Link>
                <Link to="/track-order" style={styles.dropLink}>Track Your Order</Link>
              </div>
            )}
          </div>

          {/* WISHLIST ICON */}
          <button style={styles.iconBtn}>
            <div style={{ position: 'relative' }}>
              <Heart size={22} strokeWidth={1.5} />
              {wishlist.length > 0 && <span style={styles.badge}>{wishlist.length}</span>}
            </div>
          </button>

          {/* CART ICON */}
          <button onClick={onOpenCart} style={styles.iconBtn}>
            <div style={{ position: 'relative' }}>
              <ShoppingBag size={22} strokeWidth={1.5} />
              {cart.length > 0 && <span style={styles.badge}>{cart.length}</span>}
            </div>
          </button>
        </div>
      </header>

      {/* TOP NAV MENU */}
      <nav style={styles.navBar}>
        {MENU_ITEMS.map((item) => (
          <Link key={item.label} to={item.path} style={styles.navLink}>
            {item.label}
          </Link>
        ))}
      </nav>
    </>
  );
}

const styles = {
  topBar: { background: "#1f1f1f", color: "#fff", textAlign: "center", padding: "10px", fontSize: "12px", letterSpacing: "1px" },
  header: { display: "grid", gridTemplateColumns: "1fr auto 1fr", padding: "15px 40px", borderBottom: "1px solid #eee", background: "#fff", alignItems: "center", position: 'sticky', top: 0, zIndex: 800 },
  left: { display: "flex", gap: "20px" },
  right: { display: "flex", gap: "25px", justifySelf: "end", alignItems: 'center' },
  center: { justifySelf: "center" },
  logo: { height: "45px" },
  iconBtn: { padding: 0, cursor: "pointer", display: 'flex', alignItems: 'center' },
  badge: { position: "absolute", top: "-5px", right: "-8px", background: "#c5a98d", color: "#fff", fontSize: "10px", width: "16px", height: "16px", borderRadius: "50%", display: "flex", justifyContent: "center", alignItems: "center" },

  // DROPDOWN STYLES
  accountWrap: { position: 'relative', height: '100%', display: 'flex', alignItems: 'center' },
  dropdown: {
    position: 'absolute',
    top: '100%',
    right: -10,
    background: '#fff',
    border: '1px solid #eee',
    boxShadow: '0 5px 15px rgba(0,0,0,0.05)',
    width: '180px',
    padding: '10px 0',
    display: 'flex',
    flexDirection: 'column',
    zIndex: 900
  },
  dropLink: {
    padding: '12px 20px',
    fontSize: '13px',
    color: '#333',
    textDecoration: 'none',
    transition: 'background 0.2s',
    display: 'block'
  },

  navBar: { display: "flex", justifyContent: "center", gap: "30px", padding: "15px 0", borderBottom: "1px solid #eee", fontSize: "13px", textTransform: "uppercase", letterSpacing: "1px", fontWeight: '500' },
  navLink: { color: "#000", textDecoration: "none" }
};
